hebsuperobject.biblemap.put("b21_10_2", new hebsuperobject(21,10,2,"לב חכם לימינו ולב כסיל לשמאלו׃"));
hebsuperobject.biblemap.put("b21_10_3", new hebsuperobject(21,10,3,"וגם בדרך כשהסכל הלך לבו חסר ואמר לכל סכל הוא׃"));
hebsuperobject.biblemap.put("b21_10_4", new hebsuperobject(21,10,4,"אם רוח המושל תעלה עליך מקומך אל תנח כי מרפא יניח חטאים גדולים׃"));
hebsuperobject.biblemap.put("b21_10_5", new hebsuperobject(21,10,5,"יש רעה ראיתי תחת השמש כשגגה שיצא מלפני השליט׃"));
hebsuperobject.biblemap.put("b21_10_6", new hebsuperobject(21,10,6,"נתן הסכל במרומים רבים ועשירים בשפל ישבו׃"));
hebsuperobject.biblemap.put("b21_10_7", new hebsuperobject(21,10,7,"ראיתי עבדים על סוסים ושרים הלכים כעבדים על הארץ׃"));
hebsuperobject.biblemap.put("b21_10_8", new hebsuperobject(21,10,8,"חפר גומץ בו יפול ופרץ גדר ישכנו נחש׃"));
hebsuperobject.biblemap.put("b21_10_9", new hebsuperobject(21,10,9,"מסיע אבנים יעצב בהם בוקע עצים יסכן בם׃"));
hebsuperobject.biblemap.put("b21_10_10", new hebsuperobject(21,10,10,"אם קהה הברזל והוא לא פנים קלקל וחילים יגבר ויתרון הכשיר חכמה׃"));
hebsuperobject.biblemap.put("b21_10_11", new hebsuperobject(21,10,11,"אם ישך הנחש בלוא לחש ואין יתרון לבעל הלשון׃"));
hebsuperobject.biblemap.put("b21_10_12", new hebsuperobject(21,10,12,"דברי פי חכם חן ושפתות כסיל תבלענו׃"));
hebsuperobject.biblemap.put("b21_10_13", new hebsuperobject(21,10,13,"תחלת דברי פיהו סכלות ואחרית פיהו הוללות רעה׃"));
hebsuperobject.biblemap.put("b21_10_14", new hebsuperobject(21,10,14,"והסכל ירבה דברים לא ידע האדם מה שיהיה ואשר יהיה מאחריו מי יגיד לו׃"));
hebsuperobject.biblemap.put("b21_10_15", new hebsuperobject(21,10,15,"עמל הכסילים תיגענו אשר לא ידע ללכת אל עיר׃"));
hebsuperobject.biblemap.put("b21_10_16", new hebsuperobject(21,10,16,"אי לך ארץ שמלכך נער ושריך בבקר יאכלו׃"));
hebsuperobject.biblemap.put("b21_10_17", new hebsuperobject(21,10,17,"אשריך ארץ שמלכך בן חורים ושריך בעת יאכלו בגבורה ולא בשתי׃"));
hebsuperobject.biblemap.put("b21_10_18", new hebsuperobject(21,10,18,"בעצלתים ימך המקרה ובשפלות ידים ידלף הבית׃"));
hebsuperobject.biblemap.put("b21_10_19", new hebsuperobject(21,10,19,"לשחוק עשים לחם ויין ישמח חיים והכסף יענה את הכל׃"));
