hebsuperobject.biblemap.put("b21_11_3", new hebsuperobject(21,11,3,"אם ימלאו העבים גשם על הארץ יריקו ואם יפול עץ בדרום ואם בצפון מקום שיפול העץ שם יהוא׃"));
