hebsuperobject.biblemap.put("b21_11_6", new hebsuperobject(21,11,6,"בבקר זרע את זרעך ולערב אל תנח ידך כי אינך יודע אי זה יכשר הזה או זה ואם שניהם כאחד טובים׃"));
hebsuperobject.biblemap.put("b21_11_7", new hebsuperobject(21,11,7,"ומתוק האור וטוב לעינים לראות את השמש׃"));
