hebsuperobject.biblemap.put("b21_11_9", new hebsuperobject(21,11,9,"שמח בחור בילדותיך ויטיבך לבך בימי בחורותך והלך בדרכי לבך ובמראי עיניך ודע כי על כל אלה יביאך האלהים במשפט׃"));
hebsuperobject.biblemap.put("b21_11_10", new hebsuperobject(21,11,10,"והסר כעס מלבך והעבר רעה מבשרך כי הילדות והשחרות הבל׃"));
hebsuperobject.biblemap.put("b21_12_1", new hebsuperobject(21,12,1,"וזכר את בוראיך בימי בחורתיך עד אשר לא יבאו ימי הרעה והגיעו שנים אשר תאמר אין לי בהם חפץ׃"));
hebsuperobject.biblemap.put("b21_12_2", new hebsuperobject(21,12,2,"עד אשר לא תחשך השמש והאור והירח והכוכבים ושבו העבים אחר הגשם׃"));
