hebsuperobject.biblemap.put("b21_12_6", new hebsuperobject(21,12,6,"עד אשר לא ירחק חבל הכסף ותרץ גלת הזהב ותשבר כד על המבוע ונרץ הגלגל אל הבור׃"));
hebsuperobject.biblemap.put("b21_12_7", new hebsuperobject(21,12,7,"וישב העפר על הארץ כשהיה והרוח תשוב אל האלהים אשר נתנה׃"));
hebsuperobject.biblemap.put("b21_12_8", new hebsuperobject(21,12,8,"הבל הבלים אמר הקוהלת הכל הבל׃"));
hebsuperobject.biblemap.put("b21_12_9", new hebsuperobject(21,12,9,"ויתר שהיה קהלת חכם עוד למד דעת את העם ואזן וחקר תקן משלים הרבה׃"));
hebsuperobject.biblemap.put("b21_12_10", new hebsuperobject(21,12,10,"בקש קהלת למצא דברי חפץ וכתוב ישר דברי אמת׃"));
hebsuperobject.biblemap.put("b21_12_11", new hebsuperobject(21,12,11,"דברי חכמים כדרבנות וכמשמרות נטועים בעלי אספות נתנו מרעה אחד׃"));
