hebsuperobject.biblemap.put("b21_12_13", new hebsuperobject(21,12,13,"סוף דבר הכל נשמע את האלהים ירא ואת מצותיו שמור כי זה כל האדם׃"));
hebsuperobject.biblemap.put("b21_12_14", new hebsuperobject(21,12,14,"כי את כל מעשה האלהים יבא במשפט על כל נעלם אם טוב ואם רע׃"));

